import React from 'react'

export const Pieza11 = () => {
    const handleOnClick = (e) =>{
        if(e.target.name === "top"){
            console.log("top")
        }
        if(e.target.name === "bot"){
            console.log("bot")
        }
        if(e.target.name === "left"){
            console.log("left")
        }
        if(e.target.name === "right"){
            console.log("right")
        }
        if(e.target.name === "centro"){
            console.log("center")
        }
    }
    return (
        <div className="row mt-3">
                <div className="col-12 p-tit">11</div>
                <div className="col-12">
                    <button className="circulo-top btn " onClick={handleOnClick} name="top"></button>

                </div>
                <div className="col-12">
                    <button className="circulo-left btn "onClick={handleOnClick} name="left"></button>
                    <button className="circulo-centro btn "onClick={handleOnClick} name="centro"></button>
                    <button className="circulo-right btn "onClick={handleOnClick} name="right"></button>


                </div>
                <div className="col-12">

                    <button className="circulo-bot btn " onClick={handleOnClick} name="bot"></button>

                </div>

            </div>

    )
}
